VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Hodgkinâ€™s lymphoma (HL) is a lymphoid malignancy with an emphasized incidence in developed countries. This study aimed to assess the changes in the epidemiology of HL in Finland at the population level by utilizing data from six nationwide healthcare registries. A total of 2912 patients with HL, diagnosed and treated between 2000 and 2019 were matched by controls and divided into younger (<50â€‰years) and older cohorts (â‰¥50â€‰years) for analysis. A slightly increasing trend in incidence per age group was observed. For the younger patients, the mean annual incidence was 3.19 for males and 2.89 for females. For the older patients, it was 3.07 and 1.59, respectively. Finland has higher incidence rates than other Scandinavian countries possibly due to unique human leucocyte antigen allele distribution. There was a notable increase in prevalence. For females, this was particularly emphasized between the ages of 30â€“50â€‰years, while among males, it was more evenly distributed across all ages.', '{0.2873389422893524,-0.9455093145370483,0.04560106620192528,-0.017482347786426544,-0.2282799780368805,-0.3520035743713379,1.0757739543914795,-0.7174699902534485,-1.2454832792282104,0.3988882005214691,-0.0952719897031784,0.3844444453716278,0.4265997111797333,-0.1405145227909088,0.5501196980476379,0.3171154260635376,0.8317139744758606,0.46480706334114075,0.375769704580307,-0.15487217903137207,0.2584480941295624,0.5445016622543335,-0.25790128111839294,0.7461128234863281,-0.7804083824157715,-0.5203946232795715,-0.12605978548526764,-0.2837979197502136,0.08101819455623627,-0.06710769981145859,0.15761177241802216,-0.21426735818386078,0.5145014524459839,0.12896566092967987,0.5207103490829468,0.24499864876270294,0.7004836201667786,-0.6865338087081909,-0.4742894172668457,0.3783309757709503,0.4636967182159424,-0.17557822167873383,0.3321845233440399,-0.9051053524017334,0.6756802201271057,-0.6646015644073486,-0.01666