VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'The prevalence of cardiovascular diseases has been rising globally, and various therapies have made significant strides in controlling the progression of these conditions and improving prognosis. Among these, pharmacological therapies have evolved rapidly and are increasingly integrated into clinical practice. Pharmacological treatments play a pivotal role in both basic research and clinical applications, particularly in deriving accurate conclusions from drug-related trials to address clinical challenges in drug selection and improve the cure rates of various diseases. L-type calcium channel blockers (LTCCBs) have attracted considerable research attention in recent years. With the accelerated development of novel drugs, the range of LTCCBs-based drug types has also diversified.', '{0.13592252135276794,0.4729835093021393,0.0033470704220235348,0.36860334873199463,0.08318527042865753,0.4001736044883728,0.3693779706954956,0.7630455493927002,-0.4317598342895508,-1.158883810043335,0.2927309274673462,0.7184099555015564,-0.12518446147441864,-0.7075617909431458,-0.5628319978713989,-0.26051977276802063,0.17701876163482666,0.5471462607383728,0.24721042811870575,0.2203100323677063,-0.6844351887702942,0.1408032327890396,-0.9104843139648438,-0.022050080820918083,-0.032173603773117065,-0.09986889362335205,-0.4756890535354614,0.0333344042301178,-0.12166021019220352,-0.49645543098449707,-0.1015051081776619,-1.2510066032409668,0.7144944667816162,-0.29391971230506897,0.40494248270988464,0.08169674873352051,-0.2929740250110626,1.0161782503128052,-0.30565574765205383,0.10255035012960434,-0.2011871635913849,0.44887015223503113,0.02159816399216652,-0.8567151427268982,-0.03890787437558174,-0.8408682942390442,-0.24313589930534363,0.7833709716796875,0.2580319344997406,0.09061633050441742,0.378990113735199,-0.5380046963691711,-0.5123317837715149,0.7023098468780518,-0.4337744116783142,-0.5828033089637756,0.340820670127868