VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 7, 'he association between LTCCBs and cardiovascular diseases. LTCCBs = L-type calcium channel blockers. As LTCCBs are a subclass of CCBs, the limitations observed in the general application of CCBs provide insight into areas where LTCCBs still require improvement. Dihydropyridine (DHP)-based CCBs are generally preferred in the long-acting formulation, as short-acting CCBs, while effective in lowering blood pressure, often accelerate heart rate and increase myocardial oxygen consumption. Common side effects include palpitations, flushing, headache, and lower limb edema, with occasional gum hyperplasia. Non-DHP CCBs, on the other hand, are typically used as first-line treatment for patients with chronic stable angina; however, due to their inhibitory effects on cardiac contractility and conduction, they are contraindicated in patients with second- or third-degree AV block and heart failure (HF).', '{0.20347672700881958,0.6683631539344788,0.23340286314487457,-0.19433696568012238,-0.07915834337472916,0.19172558188438416,0.2958737313747406,-0.06540720909833908,0.1297886073589325,-0.9356831908226013,0.2741430103778839,0.8716410994529724,-0.017137331888079643,-0.7293583154678345,-0.6558553576469421,-0.6240204572677612,0.04609294608235359,0.35097387433052063,0.6233698725700378,0.20449228584766388,-1.2400972843170166,0.04634840413928032,-0.7379816770553589,0.004229509271681309,0.6392952799797058,0.22865040600299835,-0.7747058868408203,-0.14467521011829376,-0.14043179154396057,-0.8029865622520447,0.11024505645036697,-0.8992295861244202,-0.0190762747079134,-0.1690465360879898,0.23661115765571594,0.4781394600868225,-0.22856447100639343,0.7540620565414429,-0.17030532658100128,0.2104315608739853,-0.06439977884292603,0.668415904045105,-0.3077179193496704,-0.6211172342300415,-0.2974059283733368,-0.14427877962589264,-0.01745905913412571,0.4546685218811035,0.23212994635105133,0.010521064512431622,0.22564445436000824