VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 8, ', they are contraindicated in patients with second- or third-degree AV block and heart failure (HF). Additionally, their combined use with Î²-blockers can exacerbate conduction block and reduce myocardial contractility, necessitating cautious monitoring. Peripheral edema is considered one of the common adverse effects associated with CCBs, believed to be secondary to small arterial dilation, which increases capillary pressure and leads to fluid extravasation into the interstitial space, resulting in edema. Makani et al confirmed that the incidence of peripheral edema gradually increases with the duration of CCBs treatment, up to 6 months. In the long term, more than 5% of patients discontinue CCBs use due to this adverse effect. Both non-DHP CCBs and lipophilic DHP CCBs have lower incidence rates of edema. From a mechanistic perspective, non-DHP CCBs exhibit negative inotropic and negative chronotropic effects.', '{0.09245403110980988,0.4107576310634613,0.3433723449707031,-0.5756452679634094,-0.09844623506069183,0.5596055388450623,0.13626649975776672,0.05705796554684639,0.2683584988117218,-0.8664857745170593,-0.13183629512786865,0.7553296089172363,0.06879254430532455,-0.05571196973323822,-0.609157145023346,-0.4820233881473541,0.022113028913736343,0.5545415878295898,1.00129234790802,0.03177107870578766,-1.7723556756973267,0.010052666999399662,-0.36934778094291687,-0.41963881254196167,1.2121738195419312,0.49742090702056885,-0.8912357091903687,0.32667621970176697,-0.3501465916633606,-0.5894286632537842,0.14489911496639252,-0.5928813815116882,-0.11140574514865875,-0.3386196196079254,0.2822134792804718,0.2161990851163864,-0.2080456167459488,0.7225926518440247,-0.3741074502468109,-0.40955784916877747,-0.045480627566576004,0.3627919852733612,0.11817055940628052,-0.6530773043632507,-0.5777790546417236,-0.3354567587375641,-0.0027233040891587734,-0.24098646640777588,-0.1544756144285202,0.2633166015148163,