VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 9, 'mechanistic perspective, non-DHP CCBs exhibit negative inotropic and negative chronotropic effects. These drugs can decrease myocardial contractility, improve ventricular filling, alleviate myocardial ischemia, and reduce left ventricular hypertrophy. Drugs like verapamil and diltiazem delay AV node conduction, increase the AV node refractory period, and are used in the treatment of hemodynamically stable SVT or recurrent SVT that cannot be terminated by adenosine or vagal maneuvers. However, in patients with pre-excitation syndrome and accessory pathway-mediated paroxysmal SVT, non-DHP CCBs may shorten the refractory period of the accessory pathway, resulting in an accelerated ventricular rate and potentially triggering ventricular fibrillation or hypotension, thus making them contraindicated in these cases.', '{-0.21211037039756775,0.4564283788204193,0.47342854738235474,-0.5513716340065002,-0.028600012883543968,-0.058207932859659195,0.1701570302248001,-0.17700782418251038,0.44295069575309753,-0.657905101776123,0.31262630224227905,1.1323137283325195,-0.138077512383461,-0.5321678519248962,-0.7644972801208496,-0.5494781732559204,-0.21977247297763824,0.5821607708930969,1.0252025127410889,0.14186325669288635,-0.5009756088256836,-0.4089161455631256,-0.5984963774681091,-0.0385073758661747,0.7212879061698914,0.06651806831359863,-0.701187014579773,0.19739748537540436,-0.16106748580932617,-0.6316656470298767,0.024593135342001915,-0.523242175579071,-0.2084115594625473,-0.23546132445335388,0.5256461501121521,-0.38664162158966064,-0.18850037455558777,0.8097516298294067,-0.18623125553131104,-0.17518430948257446,-0.06974807381629944,0.20385345816612244,0.22890135645866394,-0.17422963678836823,0.04865540936589241,-0.37142717838287354,-0.30899778008461,0.40327194333076477,-0.6097082495689392,0.35870566964149475,0.4056375026702881,-0.7363326549530029,-0.3717849850654602,0.9058958888053894,-0.4816726744174957,-0