VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Hemichorea is a rare manifestation of ischemic stroke whose lesion is typically located in the contralateral basal ganglia. Its pathomechanism has not been elucidated completely; however, it may be related to nigrostriatal dysfunction. In patients with hemichorea, dopamine transporter-single photon emission computed tomography (DAT-SPECT) reportedly displayed decreased tracer accumulation in the contralateral striatum. Moreover, in exceptional cases, responsible lesions were located in the ipsilateral cerebral hemisphere. This case report describes an 84-year-old man who presented with three weeks of intermittent, involuntary, and twisting movements in his right limbs. On physical examination, the patient had right-sided hemichorea without other neurological deficits. The choreic movements were more frequent in the lower limb than in the upper and provoked when he tried to take a certain posture or engaged in mental arithmetic.', '{-0.02404993586242199,-0.10848591476678848,0.3036036789417267,-0.6046411991119385,-0.13041852414608002,-0.12380611151456833,0.6962891221046448,-0.37076112627983093,-0.8364247679710388,-0.4112775921821594,0.5361317992210388,0.8466894030570984,-0.4065932035446167,0.031009351834654808,0.04901323467493057,0.026263516396284103,-0.004060222301632166,0.3319421112537384,0.060786399990320206,-0.8553333282470703,-0.9445497989654541,-0.6080469489097595,0.4503968060016632,-0.41870754957199097,0.608792245388031,0.6040530800819397,0.05109390243887901,-0.15329411625862122,-0.28034165501594543,-0.2780032157897949,-0.4177403748035431,-0.37012436985969543,-0.22116948664188385,-0.12718410789966583,-0.0686553418636322,0.44067123532295227,-0.25588080286979675,0.23673270642757416,-0.0693378672003746,-0.44196292757987976,-0.23850423097610474,-0.8616583347320557,0.23933067917823792,0.7279661297798157,0.26789340376853943,-0.43531912565231323,-0.2316625714302063,-0.15839503705501556,-0.42875039