VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'n in the upper and provoked when he tried to take a certain posture or engaged in mental arithmetic. Magnetic resonance imaging performed on suspicion of stroke detected a right hemispheric subacute infarct in the posterior part of the lenticular nucleus and posterior limb of the internal capsule. Furthermore, DAT-SPECT revealed decreased tracer accumulation in the right striatum. He was administered oral antiplatelet medication after being diagnosed with lacunar infarction. The choreic movements gradually reduced over the next 8â€‰months and eventually disappeared. The lesion in the lenticular nucleus and internal capsule was considered to have induced ipsilesional hemichorea, considering the temporal proximity between the hemichorea and ischemic stroke. Although DAT-SPECT findings in patients with ipsilesional hemichorea have not been reported, this case suggests that nigrostriatal dopamine dysfunction can contribute to the pathogenesis of ipsilesional hemichorea.', '{-0.09437306970357895,-0.01013106107711792,0.23375196754932404,-0.4266599416732788,0.22835247218608856,0.19670437276363373,0.6564580202102661,-0.3793182373046875,-0.1872245818376541,-0.07233213633298874,0.5857222676277161,0.6003623008728027,-0.6472383737564087,-0.6200031042098999,0.0024924753233790398,0.2859235405921936,-0.20444214344024658,0.6003548502922058,-0.09566963464021683,-0.44098666310310364,-0.5604187250137329,-0.5667047500610352,0.5032191276550293,-0.44255128502845764,0.22652532160282135,0.3802988529205322,0.5403344035148621,-0.17814050614833832,-0.4160182476043701,-0.043093860149383545,-0.44007864594459534,-0.20832529664039612,-0.05024698004126549,-0.08855249732732773,0.21040405333042145,0.5377428531646729,-0.40182849764823914,0.16601340472698212,0.30544421076774597,-0.1117214635014534,0.057970836758613586,-0.7535380125045776,0.04221257567405701,0.9682187438011169,0.356515496969223,-0.7257906198501587,-0.29785278439521