VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'at nigrostriatal dopamine dysfunction can contribute to the pathogenesis of ipsilesional hemichorea. Chorea is a hyperkinetic disorder that entails involuntary, nonrhythmic, and flowing movements in the face, neck, trunk, or limbs [ The lesion responsible for hemichorea is traditionally located in the contralateral subthalamic nucleus (STN). The presence of lesions in the cerebral cortex, caudate nucleus, putamen, globus pallidus, or thalamus can also evoke contralesional hemichorea [ Hemichorea is currently hypothesized to result from dysfunction of the hyperdirect and/or indirect pathways in the contralateral basal ganglia [ Herein, we report the rare case of a patient with ipsilesional hemichorea in whom magnetic resonance imaging (MRI) detected a small ischemic lesion in the lenticular nucleus and internal capsule. Moreover, DAT-SPECT revealed decreased tracer accumulation in the striatum of the symptomatic side.', '{-0.003625785233452916,0.12969686090946198,0.45074591040611267,-0.38526657223701477,0.18429596722126007,0.028845565393567085,0.6835370063781738,-0.30256977677345276,-0.5406346917152405,-0.27254343032836914,0.5435530543327332,0.7293208241462708,-0.43946704268455505,-0.21619786322116852,0.1430034190416336,0.058169614523649216,0.015667950734496117,0.7917529940605164,-0.02993924356997013,-0.8063280582427979,-0.9509844183921814,-0.5087338089942932,0.6256473660469055,-0.5681946873664856,0.40126147866249084,0.40492644906044006,0.19218920171260834,-0.08434945344924927,-0.45474353432655334,-0.031621675938367844,-0.2791096270084381,-0.13586179912090302,0.12968921661376953,-0.23696346580982208,0.10607180744409561,0.6084644198417664,-0.4575760066509247,-0.09039253741502762,0.10643697530031204,-0.4251593053340912,0.057682618498802185,-0.9530439376831055,0.13739001750946045,0.9456539750099182,0.34275397658348083,-0.8037150502204895,-0.2671116292476654,-0.14327898621559143,0.00566066475585103,-