VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 5, 'Moreover, DAT-SPECT revealed decreased tracer accumulation in the striatum of the symptomatic side. Hemichorea, a rare manifestation of ischemic stroke, is usually caused by lesions of the lenticular nucleus, STN, or cerebral cortex on the contralateral side [ The mechanism of chorea has not been completely elucidated; however, some major hypotheses can be found in the literature. The basal ganglia consist of the striatum, globus pallidus interna and externa (GPi and GPe), STN, and substantia nigra pars compacta and reticulata (SNc and SNr). According to a major hypothesis, there are three important pathways when processing information from the cerebral cortex [ Despite the unapparent causal association between dopaminergic dysfunction and hemichorea, DAT-SPECT was reported to detect decreased tracer accumulation in the contralateral striatum. An 82-year-old man with hyperglycemia (blood glucose level: 590â€‰mg/dL) presented with left-sided hemichorea and hemiballism.', '{0.020568443462252617,-0.16706791520118713,0.5123302340507507,-0.3765507638454437,-0.028613781556487083,0.05857855826616287,0.875280499458313,-0.15994520485401154,-0.2774043381214142,-0.19130967557430267,0.6735702157020569,0.999534547328949,-0.10996828973293304,0.010605483315885067,-0.005304534919559956,-0.07920538634061813,0.46318572759628296,0.6620736122131348,0.12567970156669617,-0.5798917412757874,-0.8761250972747803,-0.39830127358436584,0.5379963517189026,-0.6270081996917725,0.16867685317993164,0.4244363009929657,-0.07630427926778793,0.09790082275867462,-0.5864096879959106,-0.4263812303543091,-0.3077196478843689,-0.19280904531478882,0.3038786053657532,-0.09770291298627853,0.2196047157049179,0.7706312537193298,-0.5010274648666382,-0.28896868228912354,0.666300356388092,-0.5678762197494507,-0.09616311639547348,-0.5746457576751709,0.5274803042411804,1.0071989297866821,0.22886693477630615,-0.6104186773300171,0.01625741459429264,