VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Correct identification of drug and food allergies in hospitalized patients is important to prevent unwanted allergic reactions or unnecessary treatment changes. This study aimed to explain the working principle of digital patient identification systems used for drug and food allergy recording and to evaluate the results by analyzing the allergy recording system data of the general surgery clinic in our center. In our single-center, retrospective study, all patients admitted to general surgery services between January 01, 2023 and December 31, 2023 were included. Patients who were given an identifying red wristband and had allergy information on their digital patient card panel were included in the study. Patients with repeated hospitalizations within the total number of patients were included in the study as 1 patient. Data from 5810 patients hospitalized in the general surgery department for 1-year were analyzed. In total, 759 patients with allergy labels were included in this study.', '{-0.08943431079387665,-0.3387982249259949,-0.14222384989261627,0.16654035449028015,-0.04943067207932472,0.5180895328521729,0.4865400791168213,-0.3961697518825531,-0.4197048246860504,-0.33152657747268677,0.30526983737945557,0.22325749695301056,0.1527489572763443,-0.22157931327819824,0.1203237771987915,0.5514525771141052,0.47289711236953735,0.5234041810035706,0.08540903776884079,0.028443152084946632,-0.6418952345848083,-0.22145259380340576,-0.13313066959381104,0.4194176197052002,-0.4277472496032715,-0.07608569413423538,0.42600616812705994,-0.6132453680038452,-0.19987155497074127,-0.25638294219970703,0.15668447315692902,-0.5399261713027954,-0.17210200428962708,0.5263205766677856,0.00845244899392128,0.598852813243866,0.1385694295167923,-0.5177655816078186,-0.1240147277712822,1.0519874095916748,-0.6002940535545349,0.4320099651813507,0.168452188372612,-0.7614707946777344,0.2935910224914551,-0.22935110330581665,-0.2249