VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'ed as a hypersensitivity reaction to drugs that is mediated by specific antibodies or T lymphocytes. Its epidemiological risk factors are not fully understood, and severe symptoms range from mild manifestations such as erythema, skin rash, pruritus to anaphylaxis, and mortality may be observed. Underdiagnosis and overdiagnosis are common problems in drug allergies and may deprive patients of optimal drug choices. Similar to DA, food allergy (FA) can cause symptoms ranging from mild to anaphylaxis. The basis of FA treatment is the avoidance of allergens and use of appropriate diet lists. Food-derived substances used to maintain stability or bioavailability during the manufacturing process of medicines can lead to unpredictable allergic reactions. In hospitalized patients, it is essential to question and record the patientâ€™s history of allergy to a known drug to prevent possible medication errors.', '{-0.13872183859348297,-0.3334290385246277,0.28084781765937805,-0.37080827355384827,0.227752685546875,1.0258216857910156,0.8298345804214478,0.7688857316970825,-0.36558523774147034,-0.6006160974502563,0.22320885956287384,0.9853925108909607,-0.11734354496002197,-1.1880468130111694,-0.25516435503959656,0.5346249341964722,-0.3022313416004181,0.6815850138664246,0.3107543885707855,0.0017109272303059697,-1.3716890811920166,-0.2110934555530548,-0.25074952840805054,-0.32838013768196106,-0.5350695252418518,0.5812678337097168,-0.3781159818172455,-0.11759304255247116,-0.412721186876297,-0.22339634597301483,-0.010223536752164364,0.08457116037607193,-0.1940157413482666,0.0442059189081192,-0.2252119481563568,-0.040187884122133255,0.36942964792251587,-0.03891981765627861,-1.1862794160842896,0.044998299330472946,-0.65174400806427,0.3192913830280304,0.12897714972496033,-0.5607006549835205,-0.45518243312835693,0.27779421210289,-0.045840054750442505,-0.28576862812042236,-0.29001298546791077,-0.06925760954618454,0.854729